import React from 'react'
import {AppBar, Toolbar, Typography} from '@mui/material'
import MenuBookIcon from '@mui/icons-material/MenuBook';

const Header = () => {
  return (
    <div>
        <AppBar>
            <Toolbar></Toolbar>
            <Typography>
                <MenuBookIcon/>
            </Typography>
        </AppBar>
    </div>
  )
}

export default Header;
